W o m a n ⚡️ I feel so empowered when I’m next to powerful women. There’s something electric about the energy of support and “bitch let’s go!” 

Us women… we need to incorporate this more in our lives. For our friends, sisters, mothers, daughters, teachers and mentors. 

➡️ We are at times too proud to applaud our tribe. 

➡️ let’s do better. 

➡️ if you’re secure in your skin, there’s no no reason you should feel hate, jealousy of another woman. 

➡️ start feeling inspired, empowered and figuring out how to get closer with that energy. 

🛑 Tag a woman you want applaud! 👏 
